package com.gd.entity;

public class Partner {
	private long part_id;
	private Idea part_idea;
	private User part_user;
	private boolean part_user_success;
	public Partner() {
		super();
		// TODO Auto-generated constructor stub
	}
	public long getPart_id() {
		return part_id;
	}
	public void setPart_id(long part_id) {
		this.part_id = part_id;
	}
	public Idea getPart_idea() {
		return part_idea;
	}
	public void setPart_idea(Idea part_idea) {
		this.part_idea = part_idea;
	}
	public User getPart_user() {
		return part_user;
	}
	public void setPart_user(User part_user) {
		this.part_user = part_user;
	}
	
	public boolean isPart_user_success() {
		return part_user_success;
	}
	public void setPart_user_success(boolean part_user_success) {
		this.part_user_success = part_user_success;
	}
	@Override
	public String toString() {
		return "Partner [part_id=" + part_id + ", part_idea=" + part_idea
				+ ", part_user=" + part_user + ", part_user_success="
				+ part_user_success + "]";
	}
	
}
